			function initMap() {
				//var sindh = {lat: 26.5862, lng: 68.3011};
				var kp = {lat: 34.0133, lng: 71.5675};
				var map = new google.maps.Map(document.getElementById('visits-confirmed-map'), {
					zoom: 4,
					center: kp
				});
				var bounds = new google.maps.LatLngBounds();					
				google.maps.Polygon.prototype.getBounds = function() {
					var paths = this.getPaths();
					var path;        
					for (var i = 0; i < paths.getLength(); i++) {
						path = paths.getAt(i);
						for (var ii = 0; ii < path.getLength(); ii++) {
							bounds.extend(path.getAt(ii));
						}
					}
					return bounds;
				}
				$.each(coords,function(code,coord){
					if(currdist>0 && currdist!=code){return true;}
					var triangleCoords = coord;
					var sindhDist = new google.maps.Polygon({
						paths: triangleCoords,
						strokeColor: '#FF0000',
						strokeOpacity: 0.6,
						strokeWeight: 2,
						fillColor: '#FF0000',
						fillOpacity: 0.20
					});
					sindhDist.setMap(map);
					map.fitBounds(sindhDist.getBounds());
				});
				map.setCenter(bounds.getCenter());
				var infoWindow = new google.maps.InfoWindow;
				$.each(markersdata,function(index,item){
					var latt = parseFloat(item.latitude);
					var longg = parseFloat(item.longitude);
					if(latt>0 && longg>0){
						var position = new google.maps.LatLng(latt, longg);
						var mark = new google.maps.Marker({
							position: position,
							map: map,
							title: item.facility,
							icon: /* {url:  */'<?php echo $basePath; ?>dashboards/images/mobileticksmall.png'/* ,size: new google.maps.Size(20, 32)} */
						});
						var infowincontent = document.createElement('div');
						var strong = document.createElement('strong');
						strong.textContent = "Facility Visited: "+item.facility+" ("+item.facode+")";
						infowincontent.appendChild(strong);
						infowincontent.appendChild(document.createElement('br'));
						var vdate = document.createElement('text');
						vdate.textContent = "Planned Visit Date: "+item.visitdate;
						infowincontent.appendChild(vdate);
						infowincontent.appendChild(document.createElement('br'));
						var vconfirmed = document.createElement('text');
						vconfirmed.textContent = "Visit Confirmed On: "+item.date_confirmed+" "+item.time_confirmed;
						infowincontent.appendChild(vconfirmed);
						infowincontent.appendChild(document.createElement('br'));
						var sup = document.createElement('text');
						sup.textContent = "Supervisor: "+item.supervisor;
						infowincontent.appendChild(sup);
						var imgdiv = document.createElement('div');
						imgdiv.innerHTML = '<div class="img-controls"><span style="right: 50%; bottom: 5px; background: rgba(255,255,255,0.69); padding: 0px 7px 1px 7px; position: absolute;z-index: 999999; font-size: 30px; border-radius: 3px;cursor: pointer;font-weight:600;height:33px;width:35px;box-shadow:0px 1px 2px #000000b3" class="rotateicon" onclick="rotateme(this)"><span style="position:relative;margin:-10px;left:9px;z-index:9999;top:-8px;color:#0b69af;">&#8631;</span></span></div><img id="poppic" src="<?php echo $basePath; ?>assets/appimages/'+item.picture+'" style="width: 300px;height: 190px;"></img>';
						infowincontent.appendChild(imgdiv);
						//for rotation
						var scriptt=document.createElement('script');
						scriptt.type = "text/javascript";
						scriptt.text = 'var currdeg = 0;function rotateme(obj){if(currdeg==360){currdeg=0;}currdeg=currdeg+90;var elem = document.getElementById("poppic");if(navigator.userAgent.match("Chrome")){elem.style.WebkitTransform = "rotate("+currdeg+"deg)";} else if(navigator.userAgent.match("Firefox")){elem.style.MozTransform = "rotate("+currdeg+"deg)";} else if(navigator.userAgent.match("MSIE")){elem.style.msTransform = "rotate("+currdeg+"deg)";} else if(navigator.userAgent.match("Opera")){elem.style.OTransform = "rotate("+currdeg+"deg)";}else{elem.style.transform = "rotate("+currdeg+"deg)";}}';
						infowincontent.appendChild(scriptt);
						google.maps.event.addListener(mark, 'click', function() {
							infoWindow.setContent(infowincontent);
							infoWindow.open(map, mark);
						});
					}
				});
			}
			
